var successState = true;
var count = 0;
var logger = "";
UsrCaseService cs = new UsrCaseService(context.UserConnection);
var success = "";
var caseId = Get<Guid>("caseId");
Guid g = new Guid(caseId.ToString());
success = cs.SendCaseData(g);
if(success == "true") 
{
	Set("Successfully", true);
}
else
{
	Set("Successfully", false);
	count = Get<Int32>("loopCount");
	successState = Get<Boolean>("Successfully");
	logger = Get<String>("Logger");
	
	Set("Logger", "\n" + logger + "I T E R A T I O N № "+ count + ": " + success + "\n\n");
	
	if(successState == false && count == 3)
	{
		logger = Get<String>("Logger");
		throw new Exception(logger);
	}
}
return true;
